<?php

namespace Database\Seeders;

use App\Models\Category;
use Carbon\Carbon;
use Illuminate\Database\Seeder;

class CategorySeeder extends Seeder
{
    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
        $categories = [
            [
                'title' => 'Floral Art Photography',
                'description' => 'Floral photography provides an opportunity to witness beauty in small things, such as a single petal, a complex shape, or the reflection of a raindrop. The whole world can be summed up in the colors and shapes of flowers - soft yet defined, quiet but also cacophonous.  ',
                'created_at' => Carbon::now(),
                'image' => 'data:image/jpeg;base64,'
            ],
            [
                'title' => 'Abstract Art Photography',
                'description' => '',
                'created_at' => Carbon::now(),
                'image' => 'data:image/jpeg;base64,'
            ],
            [
                'title' => 'Equine',
                'description' => 'The horses shown here were photographed in a variety of contexts, real and constructed. You will find them in the surf, on the beach, in meadows, on working ranches and in the snow. Everywhere and every day they demonstrate beauty and elegant strength.',
                'created_at' => Carbon::now(),
                'image' => 'data:image/jpeg;base64,'
            ]
        ];

        foreach ($categories as $category) {
            $cat = Category::create([
                'title' => $category['title'],
                'description' => $category['description'],
                'created_at' => $category['created_at']
            ]);

            $cat->addMediaFromBase64($category['image'])->toMediaCollection('category-images', 'category-images');
        }
    }
}
